import React from 'react';

export const About = () => {
  return (
    <div className="about__info">
      <p className="paragraph">
        Lorem ipsum dolor sit, amet consectetur adipisicing elit. Voluptatibus, accusantium omnis
        explicabo voluptates assumenda ipsum ab ducimus. Tempora debitis libero ducimus, laboriosam
        ad nostrum odio vitae ratione, harum veritatis numquam.
      </p>
    </div>
  );
};
